import './App.css';
import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import logo from './icons/logo.svg';

function App() {
  return (
    <div className="App">
      <Header img src={logo} className="App-logo" alt="logo" />
      <Footer />
    </div>

  );
}

export default App;
